<template>
  <div
    id="app" ref="top" v-bind:class="[this.$store.state.baseFont ? 'opendyslexic' : '', isAnimating ? 'is-animating' : '', this.$route.name === 'welcome' ? 'welcome' : '']">
    <!-- Transition -->
    <transition name="slide-fade">
      <div class="message-wrapper" v-if="hasMessage" v-on:click="hideMessage()">
        <div class="message">
          <h3 class="first" v-html="this.message.title"></h3>
          <p class="last" v-html="this.message.text"></p>
        </div>
      </div>
    </transition>
    <!-- Header -->
    <Header
      v-if="this.$route.name !== 'welcome'"
      v-bind:story="this.stories[this.$store.state.currentStoryId]"
      v-bind:stories="this.stories"
      @openStory="openStory($event)"
      @toggleBaseFont="toggleBaseFont()"
      @scrollTop="scrollTop()"
    />
    <!-- Close navigation -->
    <div id="close-nav" @click="$emit('closeNav')"></div>
    <!-- Transitions -->
    <transition
      :name="this.transition"
      mode="out-in"
      v-on:before-leave="beforeLeave()"
      v-on:after-leave="afterLeave()"
      v-on:before-enter="beforeEnter()"
      v-on:after-enter="afterEnter()"
    >
      <router-view
        v-bind:stories="stories"
        @openStory="openStory($event)"
        @showMessage="showMessage($event)"
        @scrollTop="scrollTop()"
      />
    </transition>
    <!-- Footer -->
    <div id="footer"></div>
    <!-- Dialog -->
    <v-dialog />
    <!-- Loading screen -->
    <div id="loading-wrapper" v-if="!hasLoaded">
      <div id="loading-text">Loading&hellip;</div>
      <div id="loading-content"></div>
    </div>
  </div>
</template>

<script>
import Header from '@/components/Header.vue'
import Stories from '@/stories/ciell/ciell.js'

export default {
  data () {
    return {
      stories: Stories.sort((a, b) => (a.id > b.id) ? 1 : -1),
      transition: this.$route.name === 'home' ? 'slide-left' : 'slide-right',
      hasMessage: false,
      isAnimating: false,
      hasLoaded: false,
      message: {
        title: '',
        text: '',
        effects: null
      }
    }
  },
  components: {
    Header
  },
  methods: {
    openStory (params) {
      let id = params.id
      let taskPage = params.taskPage
      let chapterId = typeof params.chapterId !== 'undefined' ? params.chapterId : 0
      let story = Stories[id]

      if (typeof story.placeholder !== 'undefined') {
        this.$modal.show('dialog', {
          title: 'Please Note',
          text: 'This story will be available soon.',
          buttons: [
            {
              title: 'Close'
            }
          ]
        })

        return
      }

      if (taskPage) {
        let chapter = story.chapters.filter(chapter => {
          return chapter.content === '[tasks]'
        })

        if (typeof chapter[0].id === 'undefined' || !chapter[0].id) {
          chapterId = 0
        } else {
          chapterId = chapter[0].id
        }
      }

      this.$store.commit('setCurrentChapterId', chapterId)
      this.$store.commit('setCurrentStoryId', id)
      this.$router.push('story')
    },
    toggleBaseFont () {
      this.$store.commit('toggleBaseFont', !this.$store.state.baseFont)
    },
    beforeLeave () {
      this.isAnimating = true
    },
    afterLeave () {
      this.scrollTop()
    },
    beforeEnter () {
      this.transition = this.$route.name === 'home' ? 'slide-left' : 'slide-right'
    },
    afterEnter () {
      this.isAnimating = false
    },
    showMessage (message) {
      this.hasMessage = true
      this.message = message
    },
    hideMessage () {
      this.hasMessage = false
    },
    scrollTop () {
      if (this.$router.currentRoute.name !== 'home') {
        window.scrollTo(0, 0)
        document.body.scrollTop = 0
      }
    }
  },
  mounted () {
    window.addEventListener('load', () => {
      this.hasLoaded = true
    })
  }
}
</script>

